import { Router } from 'react-router-dom';

const socket = io.connect("http://localhost:8080/")

function App() {
  return(
    <Router>
    <div>
      <LoginPage socket={socket} />
      {/* <Dock socket={socket}/> */}
    </div>
    </Router>
  );
}

export default App;
